css:
atom-text-editor,
:host {
  background-color: #fff;
  color: #333333;
}
atom-text-editor,
:host {
  font-family: Consolas, "Liberation Mono", Courier, monospace;
}
atom-text-editor .invisible-character,
:host .invisible-character,
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #dddddd;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #fff;
  border-right: 1px #eee solid;
}
atom-text-editor .gutter .line-number,
:host .gutter .line-number {
  opacity: 1;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #93a1a1;
}
atom-text-editor .cursor,
:host .cursor {
  border-color: #333333;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #dddddd;
  color: #93a1a1;
}
atom-text-editor .line-number.cursor-line-no-selection,
:host .line-number.cursor-line-no-selection {
  background-color: #dddddd;
}
.bracket-matcher .region {
  background-color: #93a1a1;
  opacity: 0.7;
}
.comment {
  color: #999988 !important;
  font-style: italic;
}
.punctuation {
  color: #333333;
  font-weight: bold;
}
.punctuation.separator {
  font-weight: normal;
}
.entity {
  color: #990000;
  font-weight: bold;
}
.entity.class {
  color: #445588;
}
.entity.inherited-class {
  color: teal;
  font-weight: normal;
}
.support.class {
  color: teal;
  font-weight: normal;
}
.keyword {
  color: #333333;
  font-weight: bold;
}
.storage.type {
  color: #009926;
}
.constant {
  color: #990073;
}
.constant.numeric,
.constant.boolean {
  color: #333333;
  font-weight: bold;
}
.variable {
  color: teal;
}
.variable.parameter {
  color: #333333;
}
.delimiter,
.brace {
  color: #333333;
}
.delimiter.period {
  color: #333333;
}
.invalid.deprecated {
  text-decoration: underline;
  color: #dd1144;
}
.invalid.illegal {
  color: #dd1144;
}
.string {
  color: #dd1144;
}
.string .constant.character.escape {
  color: #dd1144;
}
.string.regexp {
  color: #009926;
}
.string.regexp .source.ruby.embedded,
.string.regexp .string.regexp.arbitrary-repitition {
  color: #009926;
}
